import SplitPane from 'react-split-pane';
import RightPanel from './components/RightPanel'

import './style.css';

const styles = {
  background: '#000',
  width: '2px',
  cursor: 'col-resize',
  margin: '0 5px',
  height: '100%',
};

function App() {

  return (
    <div>
      <SplitPane
        split="vertical"
        minSize={500}
        defaultSize={1500}
        resizerStyle={styles}>
        <div>Hello fsdfg sdofgi </div>
        <div><RightPanel /></div>
      </SplitPane>
    </div>
  );
}

export default App;
